import React from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import OrderItem from './OrderItem';

interface TableProps {
    orders:any
}

const OrderHead: React.FC = () => {
    const heads:string[]= ["Numéro de Commande", "Nom", "Total", "Status", "Date de commande"];
    return (
        <TableHead>
            <TableRow>
                {heads.map((name:string, id: number) => (
                <TableCell 
                    key={id}
                    align = {name=="Expédition" ? "center" : "left"}
                    >
                {name}
                </TableCell>
                ))}
                <TableCell align="center">Expédition</TableCell>
            </TableRow>
        </TableHead>
    );
}

const OrderTable: React.FC<TableProps> = (props) => {
    const { orders } = props;
    return (
        <div {...props}>
        <Table stickyHeader size="small">
            <OrderHead/>
            <TableBody>
                {orders.map((order) => {
                    return (
                    <OrderItem 
                        key = {order.id}
                        order={order}
                    />)}
                )}
            </TableBody>
        </Table>
        </div>
)}

export default OrderTable;
